import { Presentational as BrowseBooks } from './presentational'
export const Container=()=>{
    const [rows, setRows] = useState([
        {title: "Cáscara de nuez", author: "Ian McEwan", editorial: "Anagrama", pages: 350, year:2000, available: true}
        ,{title: "Nosotros en la noche", author: "Kent Haruf", editorial: "Literatura Random House", pages: 350, year:2000, available: true}
        ,{title: "Los milagros prohibidos", author: "Alexis Ravelo", editorial: "Siruela",pages: 350, year:2000, available: true}
        ,{title: "Orthodoxia", author: "Ulises Bértolo", editorial: "Ediciones Carena", pages: 350, year:2000, available: true}
        ,{title: "El cuento de la criada", author: "Margaret Atwood", editorial: "Salamandra", pages: 350, year:2000, available: true}
    ]);

    return(
        <BrowseBooks rows={rows} setRows={setRows} />
    )
}
